import React, { Component } from "react";

class Submit extends Component {
  render() {
    return (
      <div class='container'>
        <div class='row'>
          <div class='one column'>One</div>
          <div class='eleven columns'>Eleven</div>
        </div>
      </div>
    );
  }
}

export default Submit;
